var suggestions=document.getElementById('suggestions'),userinput=document.getElementById('userinput');document.addEventListener('keydown',inputFocus);function inputFocus(a){a.keyCode===191&&(a.preventDefault(),userinput.focus()),a.keyCode===27&&(userinput.blur(),suggestions.classList.add('d-none'))}document.addEventListener('click',function(a){var b=suggestions.contains(a.target);b||suggestions.classList.add('d-none')}),document.addEventListener('keydown',suggestionFocus);function suggestionFocus(b){const d=suggestions.querySelectorAll('a'),e=[...d],a=e.indexOf(document.activeElement);let c=0;b.keyCode===38?(b.preventDefault(),c=a>0?a-1:0,d[c].focus()):b.keyCode===40&&(b.preventDefault(),c=a+1<e.length?a+1:a,d[c].focus())}(function(){var b=new FlexSearch({preset:'score',cache:!0,doc:{id:'id',field:['title','description','content'],store:['href','title','description']}}),c=[{id:0,href:"/docs/getting-started/introduction/",title:"Introduction",description:"Githaxs is a CI as a Service Platform.",content:'\u003ch2 id="get-started"\u003eGet started\u003c/h2\u003e\n\u003col\u003e\n\u003cli\u003eNavigate to the GitHub application page for \u003ca href="https://github.com/apps/githaxs"\u003eGithaxs\u003c/a\u003e.\u003c/li\u003e\n\u003cli\u003eClick on \u003ccode\u003eInstall\u003c/code\u003e or \u003ccode\u003eConfigure\u003c/code\u003e.\u003c/li\u003e\n\u003cli\u003eSelect the GitHub Organization you want to install the application on.\u003c/li\u003e\n\u003cli\u003eSelect either \u003ccode\u003eAll repositories\u003c/code\u003e or \u003ccode\u003eOnly select repositories\u003c/code\u003e; if the latter select which repositories you wish to install the application on.\u003c/li\u003e\n\u003cli\u003eClick \u003ccode\u003eInstall\u003c/code\u003e.\u003c/li\u003e\n\u003c/ol\u003e\n'},{id:1,href:"/docs/getting-started/configuration/",title:"Configuration",description:"Githaxs | Configuration",content:'\u003cdiv class="alert alert-warning d-flex" role="alert"\u003e\n  \u003cdiv class="flex-shrink-1 alert-icon"\u003eðŸ‘‰\u003c/div\u003e\n  \u003cdiv class="w-100"\u003eYou must be an admin in your GitHub Organization to install or configure Tasks.\u003c/div\u003e\n\u003c/div\u003e\n\u003cp\u003eAfter installing the Githaxs Application certain tasks will start running by default on your entire organization. You will be re-directed to \u003ccode\u003emy.githaxs.com\u003c/code\u003e\nwhere you can update task configurations for your GitHub Organization.\u003c/p\u003e\n\u003ch4 id="task-installation"\u003eTask Installation\u003c/h4\u003e\n\u003cp\u003eA task can be configured to run in multiple different ways providing you maximum flexibility and convenience.\u003c/p\u003e\n\u003cp\u003eThe first option is to install a task on your \u003ccode\u003eEntire Org\u003c/code\u003e. With this option the task will run on \u003cem\u003eevery\u003c/em\u003e repository the Githaxs application is installed on.\u003c/p\u003e\n\u003cp\u003eIf you would like to run a task on only certain repos you can uncheck \u003ccode\u003eEntire Org\u003c/code\u003e and add a list of Repo Names or Repo Topics.\u003c/p\u003e\n\u003ch4 id="task-settings"\u003eTask Settings\u003c/h4\u003e\n\u003cp\u003eIn addition to configuring which repos a task will run on, you can provide settings for tasks that are configurable.\u003c/p\u003e\n\u003cp\u003eAs an example, the Title Lint task will check Pull Request titles to ensure they match a defined pattern which is provided by the \u003ccode\u003eregex\u003c/code\u003e parameter.\u003c/p\u003e\n\u003ch6 id="org-default"\u003eOrg Default\u003c/h6\u003e\n\u003cp\u003eOrg Default settings will be used if no other settings for a task have been set.\u003c/p\u003e\n\u003ch6 id="repo-topics"\u003eRepo Topics\u003c/h6\u003e\n\u003cp\u003eYou can provide settings based on repo topics. For example, all repos with a topic \u003ccode\u003eapi\u003c/code\u003e could be configured one way and repos with\na topic \u003ccode\u003eweb\u003c/code\u003e could be configured a different way.\u003c/p\u003e\n\u003ch6 id="repo-name"\u003eRepo Name\u003c/h6\u003e\n\u003cp\u003eYou can provide settings for a specific repo. Repo specific settings will override repo topic settings.\u003c/p\u003e\n\u003ch6 id="org-final"\u003eOrg Final\u003c/h6\u003e\n\u003cp\u003eOrg Final settings will take final precedence and apply to all repos within the GitHub Organization.\u003c/p\u003e\n\u003ch6 id="recap"\u003eRecap\u003c/h6\u003e\n\u003cp\u003eSettings will be applied in the following order, with those coming later having higher precedence:\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003eOrg Default\u003c/li\u003e\n\u003cli\u003eRepo Topics\u003c/li\u003e\n\u003cli\u003eRepo Name\u003c/li\u003e\n\u003cli\u003eOrg Final\u003c/li\u003e\n\u003c/ol\u003e\n'},{id:2,href:"/docs/getting-started/migration/",title:"Migration",description:"Githaxs is a CI as a Service platform.",content:'\u003ch2 id="how-do-i-migrate"\u003eHow do I Migrate?\u003c/h2\u003e\n\u003cp\u003eMigrating to Githaxs is \u003cstrong\u003ea lot\u003c/strong\u003e easier than migrating between other CI/CD providers. When migrating to Githaxs there is no need to translate between Jenkins and CircleCI syntax or to contact us for a migration plan.\u003c/p\u003e\n\u003cp\u003eMigration is a three-step process:\u003c/p\u003e\n\u003col\u003e\n\u003cli\u003e\n\u003cp\u003eInstall Githaxs Application.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eDelete CI tasks from your current CI tooling.\u003c/p\u003e\n\u003c/li\u003e\n\u003cli\u003e\n\u003cp\u003eConfigure Githaxs tasks.\u003c/p\u003e\n\u003c/li\u003e\n\u003c/ol\u003e\n'},{id:3,href:"/docs/getting-started/security/",title:"Security",description:"Githaxs is a CI as a Service platform.",content:'\u003ch2 id="our-practices"\u003eOur Practices\u003c/h2\u003e\n\u003cp\u003eYou can view our \u003ca href="https://security.githaxs.com/#overview"\u003eSecurity Policies and Procedures\u003c/a\u003e that are followed at Githaxs.\u003c/p\u003e\n'},{id:4,href:"/docs/help/faq/",title:"FAQ",description:"Answers to frequently asked questions.",content:'\u003ch4 id="is-githaxs-free-for-open-source-projects"\u003eIs Githaxs free for Open Source projects?\u003c/h4\u003e\n\u003cp\u003eOpen Source projects have access to our Free subscription. We currently do not provide all features to Open Source projects.\u003c/p\u003e\n\u003ch4 id="how-do-i-cancel-my-subscription"\u003eHow do I cancel my subscription?\u003c/h4\u003e\n\u003cp\u003ePlease send an email to \u003ccode\u003esubscriptions@githaxs.com\u003c/code\u003e.\u003c/p\u003e\n\u003ch4 id="have-a-question"\u003eHave a question?\u003c/h4\u003e\n\u003cp\u003ePlease send an email to \u003ccode\u003ehello@githaxs.com\u003c/code\u003e.\u003c/p\u003e\n'},{id:5,href:"/docs/help/",title:"Help",description:"",content:""},{id:6,href:"/docs/getting-started/",title:"Getting Started",description:"Githaxs | Getting Started",content:""},{id:7,href:"/docs/",title:"Githaxs",description:"Githaxs Docs.",content:""}];b.add(c),userinput.addEventListener('input',e,!0),suggestions.addEventListener('click',f,!0);function e(){var g=this.value,e=b.search(g,5),f=suggestions.childNodes,h=0,i=e.length,c;for(suggestions.classList.remove('d-none'),e.forEach(function(b){c=document.createElement('div'),c.innerHTML='<a href><span></span><span></span></a>',a=c.querySelector('a'),t=c.querySelector('span:first-child'),d=c.querySelector('span:nth-child(2)'),a.href=b.href,t.textContent=b.title,d.textContent=b.description,suggestions.appendChild(c)});f.length>i;)suggestions.removeChild(f[h])}function f(){while(suggestions.lastChild)suggestions.removeChild(suggestions.lastChild);return!1}})()